 Management System), Database and App.\r\n-              Create separate users privileges and accounts for controlling CMS per each agency and car selling shops\r\n \r\nbrief:\r\nMotor&#39;s Talk was founded in 2015 by Emirati developer. Our mission is to provide the users the ability to explore car agencies, external garages, painting, car wash, tire shops and more. Also we provide important details such as phone number, prices list and map. In addition, registered users can add comments and rate the garages they like the most!\r\nMotor&#39;s Talk vision is to bring all car agencies and other external garages into one mobile app, so everyone can be able to find anything within few clicks.\r\n \r\n---------------------------\r\nProblem:\r\n \r\n \r\nHave you ever faced the following situation:\r\n1) &#34;I just bought a new car, but I do not know from where I can get a good tint at a lower price?&#34;\r\n2) &#34;I want to buy a new car with good price and I don&#39;t want to waste time and money by visit each branches&#34;\r\n3) &#34;I have to replace my car parts, but I just don&#39;t know anything about it. I need help!!&#34;\r\n4) &#34;Summer is coming, I need to have a complete check on my car, I need to find the best shop which will offer me good rates &#34;\r\n5) &#34;I feel there is some problem with my car tire, however, I am not sure which shop I need to go to as I do not know anything about it&#34;\r\n6) &#34;Why is this shop charging me more to repair my AC as the other shop is charging me less? Who should I trust?&#34;\r\n6) Etc...\r\nHalf of the people in UAE share the same concern as the above scenarios. There are many agencies, shops and stores offering services on car, tires,\r\nspare parts etc., however, there is no single stop place which gives a complete information and advice on such matters. There are many shops which manipulates\r\nthe prices of the purchase taking advantage of the end-user who has no knowledge.\r\nSolution:\r\nMotor&#39;s Talk provides an end-to-end information ( but not limited to ) on car services, tire repair shops, spare parts prices, paint shops etc.\r\ngiving a complete holistic view of items involved when it comes to car purchases.\r\nIt serves as a true medium in providing the end-users the information about the exact prices while purchasing any item related to cars and their parts.\r\nThis application will make sure that the people in UAE know the exact rights and prices when it comes to car jobs.\r\nMotor&#39;s talk will ensure to serve the people of UAE in a true medium by leasing between the consumer (protecting the rights) and car related shops.\r\n \r\nlinks: https://motorstalk.net','','Yes','',0,NULL),(362,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(363,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(364,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(365,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(366,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(367,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(368,'test@gmail.com','test@gmail.com','','','','','test@gmail.com (Get In touch)','','Yes','',0,NULL),(369,'test@gmail.com','test@gmail.com','','','','','test@gmail.com','','Yes','',0,NULL),(370,'test@gmail.com','test@gmail.com','','','','','test@gmail.com (Get In touch)','','Yes','',0,NULL),(371,'test@gmail.com','test@gmail.com','','','','','test@gmail.com (icon)','','Yes','',0,NULL),(372,'test@gmail.com','test@gmail.com','','','','','test@gmail.com get in touch 850','','Yes','',0,NULL),(373,'test@gmail.com','test@gmail.com','','','','','test@gmail.com icon 851','','Yes','',0,NULL),(374,'test@gmail.com','test@gmail.com','','','','','test@gmail.com icon 852','','Yes','',0,NULL),(375,'test@gmail.com','test@gmail.com','','','','','test@gmail.com get in touch 