m interested in having a rewards/loyalty programme developed for retail outlets and also restaurants. I am sure there are many ways to implement such a program, so your thoughts would be welcome. As for me, it is kind of difficult for me to explain via email, so if we can discuss over skype, that would be great. but this below is the rough idea behind it;\r\nI sign up partners/vendors (restaurants, retails stores) on the platform\r\nCustomers of these vendors download an app (it\'s just one app)\r\nWhen customers visit any of these stores, they choose the respective store on the app\r\nUnder that store, they get to see their rewards history and how many points they have accumulated, etc for that particular store. Or they can see their entire history in a dashboard form\r\nWhen they want to earn rewards for their current purchase, they would open the app, use their NFC enabled phone and tap against an NFC enabled device at the respective store OR they would scan from the app itself a QR code unique to the store, which would be placed near the cashier as they are making the purchase and paying for it. \r\nOnce they have collected the required amount of app-stamps, the reward will be triggered, which they can redeem at any time within a specified time frame at the press of a button. Once they have redeemed, their digital stamp card then resets back to zero. \r\nCustomers can also check through a map format about which places are offering specials, or are offering loyalty rewards\r\nSome of the advantages I see with this method are that;\r\nFor the customer (rewards member), they do not need a separate app (or in the case of cards that many businesses still use, separate cards) for each vendor. All the stores/vendors are in one app, \r\nFor the customer, they get free goodies from their favourite stores for being loyal clients\r\nFor the vendor, they do not need to develop a separate rewards program. All they do is pay a monthly fee to us as service providers, \r\nFor the vendor, the loyalty programme encourages spending and builds loyalty\r\nFor us as service providers, we make money by charging a small monthly fee to the vendors plus an x amount for every transaction recorded on the app. \r\nSome of the features I envision are;\r\ndashboard for each vendor where they can view their rewards members transactions and all other insights\r\nability for each vendor through their dashboard to send promotional SMS\'s to their reward members. \r\nability to send notifications on the app through beacons\r\nemail notification when points earned\r\nvendors can cross-market. For example, spend at business x and earn a reward at business y.\r\nThis is just a brief scope. I am sure there are many considerations and many potential features that I have not mentioned. \r\n\r\nPlease advise if this is something that would interest you. If so, looking forward to a reply, and having a chat over the phone as well.\r\n\r\nRegards.\r\n\r\nMohammed\r\n','get_in_touch','','2019-10-21 03:03:52'),(3131,'Jamaal Ali','amazninc@gmail.com','7038640805','','','','','I am starting a business, and developing a business proposal for potential investors, to finance the systems my business will be using to operate with the public. I would like to get an estimate on what it would cost to acquire your services to build an app. How can I go about scheduling a call to get an estimate for your services?','get_in_touch','','2019-10-21 09:38:46'),(3132,'Techugo','amar@techugo.com','1234567890','','10000 USD to 20000 USD','','','Amar-Mac','home','','2019-10-21 21:44:18'),(3133,'Aboutus','amar@techugo.com','123456789','','10000 USD to 20000 USD','','','Amar-Mac','about','','2019-10-21 21:44:49'),(3134,'Get in touch','amar@techugo.com','1234567890','','','','','Amar-Mac','get_in_touch','','2019-10-21 21:45:07'),(3135,'Contact us ','amar@techugo.com','1234567890','','','','','Amar-Mac','get_in_touch','','2019-10-21 21:45:31'),(3136,'Android','amar@techugo.com','123456789','','