INSERT INTO `w_podcast` VALUES (1,'How chatbots can help your business to elevate customer-service?','Are you willing to double your revenue??? Identify the sweet spot for your marketing initiatives through Chatbot and bring an incredible customer-service along with. ','audio_1577945016ChatboatsinBusiness.mp3','thumb_15779418253.jpg',NULL,'how-chatbots-can-help-your-business-to-elevate-customer-service',NULL,NULL,'audio','Bhavna','active','2019-12-04 10:58:22','2020-01-02 06:03:47'),(2,'Let’s hop onto the multi-million Question; what all it takes to create an app like TaskRabbit','Leah Busque has changed GIG-Economy forever with TaskRabbit. Do you wonder how an app like TaskRabbit can come into existence? ','https://www.youtube.com/watch?v=_705aM1GHQI','https://img.youtube.com/vi/_705aM1GHQI/sddefault.jpg','_705aM1GHQI','',NULL,NULL,'video','Abhinav Singh','active','2019-12-18 09:52:48','2019-12-18 11:51:29'),(3,'iOS 13.2 Update: Unleash What’s New???','iOS 13.2 is a feature-packed update, released after three interim rounds, and has brought many new features apart from bug fixing from prior releases. Listen to the full roundup covered in this Podcast…\r\n\r\n','audio_1577942504iOS13.2update.mp3','thumb_1577942511iOS13.2.png',NULL,'ios-13.2-update--unleash-whats-new',NULL,NULL,'audio','Vivek Indra','active','2020-01-02 05:21:51','2020-01-10 04:52:29'),(4,'Hidden benefits of GitHub; you should not ignore anymore!','','audio_1579692255Podcast2_Git_hub_launches_mobile_app_Shally.mp3',NULL,NULL,'hidden-benefits-of-github-you-should-not-ignore-anymore-',NULL,NULL,'audio','Shally','inactive','2020-01-22 11:24:17','2020-01-22 11:01:33');
